import { Link } from "react-router-dom";
import styled from "styled-components";

const Container = styled.div`
display:flex;
justify-content: center;
align-items:center;

`;
const Header = styled.header`

`;
const Title = styled.h1`
font-size:2.5em;
`;
const CoinsList = styled.ul`
`;
const Coin = styled.li``;

const coins = [
  {
    id: "btc-bitcoin",
    name: "Bitcoin",
    symbol: "BTC",
    rank: 1,
    is_new: false,
    is_active: true,
    type: "coin",
  },
  {
    id: "eth-ethereum",
    name: "Ethereum",
    symbol: "ETH",
    rank: 2,
    is_new: false,
    is_active: true,
    type: "coin",
  },
  {
    id: "hex-hex",
    name: "HEX",
    symbol: "HEX",
    rank: 3,
    is_new: false,
    is_active: true,
    type: "token",
  },
];

const Coins = () => {
  return(
    <Container>
      <Header>
        <Title>모든 코인</Title>
        <CoinsList>
          {coins.map((coin) => (
            <Coin key={coin.id}>
              <Link to ={`/${coin.id}`}> {coin.name} </Link>
            </Coin>
          ))}
        </CoinsList>
      </Header>
    </Container>
  )
}
export default Coins;
